const FilterComponent = ({category, name, linkname, listname}) => {
    return (
        <div className={ "mainfilters__component " + category }>
            <div className="mainfilters__titleblock">
                <div class="mainfilter__title">{ name }</div>
                <div class="mainfilters__link hidden">{ linkname }</div>
            </div>
            <div class="mainfilters__input--list">{ listname }</div>
        </div>
    )
}

export default FilterComponent
